import React, { Component } from 'react';
import { FormGroup, InputGroup } from '@blueprintjs/core';

export default class CreateUserForm extends Component {
   render() {
      return (
         <div>
            <FormGroup
               helperText='Please provide username'
               label='Username / Email'
               labelFor='text-input'
               labelInfo='(required)'
               inline
            >
               <InputGroup
                  leftIcon='envelope'
                  onChange={this.props.onChange}
                  placeholder='Username...'
                  type='email'
                  value={this.props.email}
               />
            </FormGroup>
            <FormGroup
               helperText='Please provide password'
               label='Password'
               labelFor='text-input'
               labelInfo='(required)'
               inline
            >
               <InputGroup
                  leftIcon='envelope'
                  onChange={this.props.onChange}
                  placeholder='Username...'
                  type='password'
                  value={this.props.email}
                  fill
               />
            </FormGroup>
         </div>
      );
   }
}
